import React from 'react'
import ReactDOM from 'react-dom'
import './style.css'

function App() {
    const firstName = "super"
    const lastName = "man"
    return(
    <h1>I'm {`${firstName} ${lastName}`}</h1>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));
